import { StyleSheet } from "@react-pdf/renderer"

import global from "./global"

export default StyleSheet.create({
  ...global,
  container: {
    display: "flex",
    flexDirection: "column",
    margin: "20 auto",
    width: "85%",
    height: "40%",
    backgroundColor: "#e6f2ff",
  },

  image: {
    maxWidth: "100%",
    height: "auto",
    margin: "0 auto",
    backgroundColor: "white",
  },

  name: {
    fontSize: "20px",
    textAlign: "center",
    paddingTop: "10",
  },
})
